  function waitForElm(selector) {
    return new Promise(resolve => {
        if (document.querySelector(selector)) {
            return resolve(document.querySelector(selector));
        }

        const observer = new MutationObserver(mutations => {
            if (document.querySelector(selector)) {
                resolve(document.querySelector(selector));
                observer.disconnect();
            }
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });
    });
}

waitForElm('.swiper').then((elm) => {
    var swiper = new Swiper(".swiper", {
        slidesPerView: 1,
        spaceBetween: 0,
        loop: true,
        speed:700,
        autoplay: {
          delay: 4000,
          disableOnInteraction: false,
        },
      });
});
waitForElm('#page_header').then((elm) => {
    var pageHeader = document.querySelectorAll('#page_header');
    var fakeLink = document.createElement('a');
    fakeLink.classList.add('linkCover');
    fakeLink.href="https://www.putgang.com/join";
    /* create wrapper */
    var fakeHeader = document.createElement('div');
    fakeHeader.classList.add('headerCover');
    var fakeHeaderInner = document.createElement('div');
    fakeHeaderInner.classList.add('headerInner');
    fakeHeaderInner.appendChild(fakeLink);
    fakeHeader.appendChild(fakeHeaderInner);
    pageHeader[0].insertBefore(fakeHeader,pageHeader.firstChild);
});



